import * as d3 from 'd3'
import { useEffect, useState } from 'react'

function SessionDuration(sessionData) {
    const [SvgWeight, setSvgWeight] = useState()

    useEffect(() => {
        const SvgWeightCreation = d3
            .select('.session-box')
            .append('svg')
            .attr('width', 250)
            .attr('height', 250)
            .style('background', '#FF0000')
            .style('border-radius', '10px')
            .append('p')
            .text(`${sessionData.sessionData[0].sessionLength}`)
        setSvgWeight(SvgWeightCreation)
    }, [])

    return (
        <>
            <div className="session-box bg-gray-100 rounded-md"></div>
        </>
    )
}

export default SessionDuration
